import React, { useState } from 'react';
import Axios from 'axios'

import axios from 'axios';

function AddTimeTable(){

  const[subjectName,setsubjectName] = useState("");
  const[Day,setDay] = useState("");
  const[TimeStart,setTimeStart] = useState("");
  const[TimeEnd,setTimeEnd] = useState("");

  const addnew = () =>{
    axios.post("http://localhost:8070/timetable/add",{subjectName,Day,TimeStart,TimeEnd})
  }

  return(
    <div className='container'>
        <label>Subject</label>
        <input type="text" onChange={(e)=>{setsubjectName(e.target.value)}}/>
        <label>Day</label>
        <input type="text" onChange={(e)=>{setDay(e.target.value)}}/>
        <label>TimeStart</label>
        <input type="text" onChange={(e)=>{setTimeStart(e.target.value)}}/>
        <label>TimeEnd</label>
        <input type="text" onChange={(e)=>{setTimeEnd(e.target.value)}}/>

    </div>
  )

}
 





export default AddTimeTable;
